import React from "react";
import "../Styles/login.css"

export default class Login extends React.Component {

    render() {

        return (
            <div className="login-page">
                <p className="topic" style={{margin:"auto",marginBottom:"1rem"}}>ورود</p>
                <input className="input" label="نام کاربری" placeholder="نام کاربری"/>
                <input className="input" label="رمزعبور" placeholder="رمز عبور"/>
            <div className="btn-container">
                <button className="negative-btn">انصراف</button>
                <button className="positive-btn">ورود</button>
            </div>
            </div>

        )
    }
}
